/* eslint-disable no-array-constructor */
'use strict';

var isEmptyArray = require( './../lib' );

console.log( isEmptyArray( [] ) );
// => true

console.log( isEmptyArray( new Array() ) );
// => true

console.log( isEmptyArray( [ 1, 2, 3 ] ) );
// => false

console.log( isEmptyArray( {} ) );
// => false
